message:
Bolsonaro enviou a família para a Flórida que atualmente viaja para este destino no avião presidencial.  Na Flórida, há Trump.  Tudo indica que Trump garantiu a Bolsonaro o apoio necessário para que o presidente brasileiro ative o artigo 142 da Constituição brasileira.  O Artigo 142 prevê o uso de forças armadas para impedir uma tentativa de subverter a ordem constitucional.  São horas de espera de milhões de brasileiros esperando saber o destino de seu país.

